import axios from "axios";

export const getMovieList = () => axios.get('http://kobis.or.kr/kobisopenapi/webservice/rest/boxoffice/searchDailyBoxOfficeList.json?key=5622df58bf74fc555a60bcb2baf58da6&targetDt=20210322')
    .then((res) => {
        return res.data
    })

export const getMoviePoster = () => axios({
    method: 'get',
    url: "https://openapi.naver.com/v1/search/movie.json?query=미나리",
    headers: {
        "X-Naver-Client-Id": '2uVVLxbExNrX8fs5qa9c',
        "X-Naver-Client-Secret": 'ttO9VQ7JM4',
    }
})
